import logo from './img/LocalendarLogo.svg';
import React, {Component} from 'react';

class Home extends Component {

  constructor(props) {
    super(props);
    this.state = {
      panelTransform: 'translateX(100%)',
      eventWrapperDim: 'rgb(214, 196, 171)',
      eventDim: '#2E5584',
    };
  }

  togglePanel = (action) => {
    if (action === 'close') {
      this.setState({
      panelTransform: 'translateX(100%)',
      eventWrapperDim: 'rgb(214, 196, 171)',
      eventDim: '#2E5584',
      });
    } else {
      this.setState({
        panelTransform: 'translateX(0%)',
        eventWrapperDim: 'rgb(87, 79, 69)',
        eventDim: '#15263b',
      });
    }
  };

  render () {
    return (
      <div>
        <div id='sidePanel' style={{transform: this.state.panelTransform}}>
          <div id='profileContainer'>
            <div id='profileName'>Keaton</div>
            <div id='profilePicture'></div>
          </div>
          <div id='viewProfile'>View Profile</div>
          <div id='createPost'>Create Post</div>
          <div id='signOut'>Sign Out</div>
        </div>
        <div>
          <div id='pageHeader'>
            <img src={logo} alt='logo' className='logo'/>
            <div id='navBarContainer' onClick={()=>this.togglePanel('open')}>
              <div className='navBarLine'></div>
              <div className='navBarLine'></div>
              <div className='navBarLine'></div>
            </div>
          </div>
          <div id='eventsContainer' onClick={()=>this.togglePanel('close')}
            style={{backgroundColor: this.state.eventWrapperDim}}>
            <div className='event' style={{backgroundColor: this.state.eventDim}}></div>
            <div className='event' style={{backgroundColor: this.state.eventDim}}></div>
            <div className='event' style={{backgroundColor: this.state.eventDim}}></div>
            <div className='event' style={{backgroundColor: this.state.eventDim}}></div>
            <div className='event' style={{backgroundColor: this.state.eventDim}}></div>
            <div className='event' style={{backgroundColor: this.state.eventDim}}></div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
